import Testing

struct LeetCode1208Tests {
  private let problem = LeetCode1208()

  @Test func example1() {
    let result = problem.equalSubstring("abcd", "bcdf", 3)
    #expect(result == 3, "Expected '3', but got '\(result)'")
  }

  @Test func example2() {
    let result = problem.equalSubstring("abcd", "cdef", 3)
    #expect(result == 1, "Expected '1', but got '\(result)'")
  }

  @Test func example3() {
    let result = problem.equalSubstring("abcd", "acde", 0)
    #expect(result == 1, "Expected '1', but got '\(result)'")
  }

  @Test func example4() {
    let result = problem.equalSubstring("krrgw", "zjxss", 19)
    #expect(result == 2, "Expected '2', but got '\(result)'")
  }

  @Test func example5() {
    let result = problem.equalSubstring("abcd", "bccd", 1)
    #expect(result == 3, "Expected '3', but got '\(result)'")
  }

  @Test func example6() {
    let result = problem.equalSubstring("agzxjgvcsubbxeyn", "nopafyvjfvekmnfp", 112)
    #expect(result == 12, "Expected '12', but got '\(result)'")
  }

  @Test func example7() {
    let result = problem.equalSubstring("", "", 93020)
    #expect(result == 10948, "Expected '10948', but got '\(result)'")
  }
}
